(212, 1, '2023-12-26 00:20:25', '2023-12-26 00:20:25', '<div id="" class="wrapper wrapper__spacing-bottom-large--20">\r\n<div class="block-heading">\r\n<h2 class="heading heading__align--left heading__color--shaft heading__size--small block-heading__heading"><strong>Reliable</strong></h2>\r\n</div>\r\n</div>\r\n<div id="" class="wrapper wrapper__spacing-bottom-large--0">\r\n<p class="paragraph paragraph__color--dove paragraph__align--left paragraph__size--default block-paragraph__paragraph">Designed in accordance with international quality and safety standards, the IP66 rated design can withstand a wide range of environmental conditions.​ Featuring 0-export limitation, DC reverse polarity protection and AC sensitive residual-current monitoring function ensures long-term operation with a strong focus on safety for installers and end-users.</p>\r\n\r\n<div id="" class="wrapper wrapper__spacing-bottom-large--20">\r\n<div class="block-heading">\r\n<h2 class="heading heading__align--left heading__color--shaft heading__size--small block-heading__heading"><strong>Powerful</strong></h2>\r\n</div>\r\n</div>\r\n<div id="" class="wrapper wrapper__spacing-bottom-large--0">\r\n<p class="paragraph paragraph__color--dove paragraph__align--left paragraph__size--default block-paragraph__paragraph">The ASW 3-6K S Series has an increased input current of 16 A, an input (DC) of min 60 V, max 580 V and initial Dual independent MPP tracker and wide MPP voltage range ensure optimal energy generation for high yields.​ Up to 150% oversizing of the PV array, ensures optimal energy yields and high flexibility for residential rooftop PV system design.</p>\r\n\r\n<div id="" class="wrapper wrapper__spacing-bottom-large--20">\r\n<div class="block-heading">\r\n<h2 class="heading heading__align--left heading__color--shaft heading__size--small block-heading__heading"><strong>Easy to install</strong></h2>\r\n</div>\r\n</div>\r\n<div id="" class="wrapper wrapper__spacing-bottom-large--0">\r\n<p class="paragraph paragraph__color--dove paragraph__align--left paragraph__size--default block-paragraph__paragraph">Equipped with Phoenix Contact DC connectors to ensure fast and easy installation with standard tools and quick setup and easy commissioning with AISWEI Apps. Plug and play Wi-Fi and 4G sticks allows easy monitoring of up to five inverters, and can support users to monitor power data 24/7, including customers’ household data through the optional “Night monitoring” feature.​</p>\r\n\r\n</div>\r\n</div>\r\n</div>', 'SOLPLANET ASW3680-S-G2 (3.68kWac, 1 Phase)', '', 'publish', 'open', 'closed', '', 'solplanet-asw3680-s-g2-3-68kwac-1-phase', '', '', '2023-12-29 05:22:31', '2023-12-29 05:22:31', '', 0, 'https://www.serply.my/?post_type=product&#038;p=212', 0, 'product', '', 0);
