(375, 1, '2023-09-05 02:22:36', '2023-09-05 02:22:36', '<div id="" class="wrapper wrapper__spacing-bottom-large--20">\n<div class="block-heading">\n<div id="" class="wrapper wrapper__spacing-bottom-large--20">\n<div class="block-heading">\n<h2 class="heading heading__align--left heading__color--shaft heading__size--small block-heading__heading">Reliability</h2>\n</div>\n</div>\n<div id="" class="wrapper wrapper__spacing-bottom-large--0">\n<p class="paragraph paragraph__color--dove paragraph__align--left paragraph__size--default block-paragraph__paragraph">Compliance with international quality and safety standards. A technical design offering a combination of DC reverse polarity protection plus an AC-sensitive residual-current monitoring function ensures protection and safety for installers and end-users. Built-in surge protection device (type II) for inverter protection against lightning threats. IP66-rated design with powder-coated housing delivers solid, long-term performance against the impact of harsh environments.</p>\n\n<div id="" class="wrapper wrapper__spacing-bottom-large--20">\n<div class="block-heading">\n<h2 class="heading heading__align--left heading__color--shaft heading__size--small block-heading__heading">Robust Power Supply</h2>\n</div>\n</div>\n<div id="" class="wrapper wrapper__spacing-bottom-large--0">\n<p class="paragraph paragraph__color--dove paragraph__align--left paragraph__size--default block-paragraph__paragraph">Rated up to 32A rated input current per MPPT enables dual unit installation with more flexibility for high power, bi-facial, and large area PV modules. A wide MPP voltage range with the capability of 150% oversizing of the PV array ensures optimized energy yield and applicable flexibility in nearly every situation. Compact design execution with optimized thermodynamics generates a high power yield. A wide MPP voltage range with 150% oversizing of the PV power array ensures optimized energy yield and application flexibility when facing a variety of conditions.</p>\n\n<div id="" class="wrapper wrapper__spacing-bottom-large--20">\n<div class="block-heading">\n<h2 class="heading heading__align--left heading__color--shaft heading__size--small block-heading__heading">Easy Installation</h2>\n</div>\n</div>\n<div id="" class="wrapper wrapper__spacing-bottom-large--0">\n<p class="paragraph paragraph__color--dove paragraph__align--left paragraph__size--default block-paragraph__paragraph">Features including Phoenix contact DC connectors enable quick and easy installation with standard tools.​ Plug &amp; play Wi-Fi and 4G sticks allow easy monitoring for up to five inverters.​ Quick setup and easy commissioning with the smart cloud-based ASWEI app provide user-friendly tracking wherever you are.</p>\n\n</div>\n</div>\n</div>\n</div>\n</div>', 'SOLPLANET ASW10K-LT-G2 Pro (10kWac, 3 Phase) | Free Delivery WM+WIFI Dongle+10 Years Warranty', '', 'inherit', 'closed', 'closed', '', '225-autosave-v1', '', '', '2023-09-05 02:22:36', '2023-09-05 02:22:36', '', 225, 'https://www.serply.my/?p=375', 0, 'revision', '', 0),
